import styled from 'styled-components';

export const Landing = styled.div`
width: 100vw;
height: 100vh;
background: linear-gradient(to left, #000, #333);
& button{
    background: transparent;
    border: none;
    position: relative;
    & img{
        width: 10rem;
        cursor: pointer;
        &:hover{
            filter: brightness(.7);
        }
        &:focus{
            filter: brightness(.4);
        }
    }
    & p {
        position: absolute;
        top: 0;
        left: 22%;
    }
}
`
